        label = "SOMES",
        string = "1/3/5/6/5/5/3/"
    }
}
local asciiIndex = 1

dropdown.MouseButton1Click:Connect(function()
    asciiIndex = asciiIndex + 1
    if asciiIndex > #asciiList then
        asciiIndex = 1
    end
    local entry = asciiList[asciiIndex]
    local asciiBlock = ("--[[\n" .. entry.string .. "\n[" .. entry.count .. "] - " .. entry.label .. "\n]]")
    if setclipboard then
        setclipboard(asciiBlock)
    end
    dropdown.Text = "✔ Copied: " .. entry.name
    wait(2)
    dropdown.Text = "Pick Credit (Click to Cycle)"
end)

local function v1(v2)
    local v3 = {}

    local v4 = "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789____________________________________________________________________________________________________________________"
    for v5 = 1, v2 do
        local v6 = math.random(5, 20)
        local v7 = ""
        for v8 = 1, v6 do
            local v9 = math.random(1, #v4)
            v7 = v7 .. v4:sub(v9, v9)
        end
        table.insert(v3, v7)
    end
    return table.concat(v3, "")
end

encodeBtn.MouseButton1Click:Connect(function()
    local raw = input.Text
    if raw == "" or raw == "-- Paste code here" then 
        output.Text = "-- Please enter code to obfuscate"
        return 
    end

    local header = "--[[ █████╗ ██╗  ██╗██╗   ██╗███████╗     ██████╗ ██████╗ ███████╗██╗   ██╗███████╗ ██████╗ █████╗ ████████╗ ██████╗ ██████╗ \n██╔══██╗╚██╗██╔╝██║   ██║██╔════╝    ██╔═══██╗██╔══██╗██╔════╝██║   ██║██╔════╝██╔════╝██╔══██╗╚══██╔══╝██╔═══██╗██╔══██╗\n███████║ ╚███╔╝ ██║   ██║███████╗    ██║   ██║██████╔╝█████╗  ██║   ██║███████╗██║     ███████║   ██║   ██║   ██║██████╔╝\n██╔══██║ ██╔██╗ ██║   ██║╚════██║    ██║   ██║██╔══██╗██╔══╝  ██║   ██║╚════██║██║     ██╔══██║   ██║   ██║   ██║██╔══██╗\n██║  ██║██╔╝ ██╗╚██████╔╝███████║    ╚██████╔╝██████╔╝██║     ╚██████╔╝███████║╚██████╗██║  ██║   ██║   ╚██████╔╝██║  ██║\n╚═╝  ╚═╝╚═╝  ╚═╝ ╚═════╝ ╚══════╝     ╚═════╝ ╚═════╝ ╚═╝      ╚═════╝ ╚══════╝ ╚═════╝╚═╝  ╚═╝   ╚═╝    ╚═════╝ ╚═╝  ╚═╝ ]]\n\n"

    local obfuscated = ""
    local vars = {}

    for i = 1, #raw do
        local byte = string.byte(raw, i)
        local varName = v1(math.random(1, 50))
        obfuscated = obfuscated .. "local " .. varName .. "='" .. byte .. "';"
        table.insert(vars, varName)
    end

    local final = header .. obfuscated .. "loadstring(string.char(" .. table.concat(vars, ",") .. "))()"
    output.Text = final
end)

copyBtn.MouseButton1Click:Connect(function()
    if output.Text == "-- Encoded output here" then
        output.Text = "-- Nothing to copy! Encode something first."
        return
    end
    
    if setclipboard then
        setclipboard(output.Text)
        copyBtn.Text = "✔ Copied!"
        wait(2)
        copyBtn.Text = "Copy"
    else
        warn("Clipboard not supported on this executor")
        copyBtn.Text = "⚠ No Clipboard"
        wait(2)
        copyBtn.Text = "Copy"
    end
end)
